column8:
おにぎりケース：重ねてしまえるおにぎりケース
大・中・小の３種類ありカロリーがわかるから自分に合った量のおにぎりをご用意できます（＾ｖ＾）おにぎりの形が上手く握れない...
せっかく握ったおにぎりがケースに入らない...
そんな時このおにぎりケースを使えば簡単に解決！！

<br><br>
<b>【送料につきまして】</b>
<br><br>

送料は一律750円頂戴いたしております。<br>
北海道、沖縄、離島のお客様に限り、<br>
別途送料を頂戴いたしております。<br>
何卒ご了承下さいませ。<!--削除厳禁-->
<div ALIGN="CENTER" class="box_full">



</div>
<style type="text/css">
<!--
