<style>
#Kokuchi{
	margin:0 0 5px 0;
	padding:3px 3px 3px 10px;
	width:100%;
	height:150px;
	border: 1px #c0c0c0 solid;
	background-color:#fff;
}
#Kokuchi h2{
	font-size:16px;
	color:#FF6600;
}
#Kokuchi p{
	margin:0;
	padding:3px;
	text-align:center;
}
#Kokuchi ul{
	width:90%;
	margin:0;
	padding:2px 0 2px 0;
	font-size:12px;
}
#Kokuchi ul li{
	padding:2px 0 2px 0;
	list-style-type:none;
}
#sale .pictlist{width:650px;text-align:center;padding:0 0 2px 0;
margin:1px 0 3px 0px;
border-bottom:#999999 solid 3px;
}
#sale .pictlist a{padding:0 1px 0 1px;
}
.scroll{
	overflow: auto;
}
/*----------SuperSALE etc-----------------------------------------------------*/
#KansyaFes{
	width:100%;
	margin:0 0 3px;
	padding:0;
	background-color:#F7F7F7;
}
#KansyaFes div{
	text-align:center;
	margin:2px 0 2px 0;
	padding:0;
}
#KansyaFes h3{
	background-color:#FF0;
	text-align:center;
}
#KansyaFes ul{
	padding:0;
	margin:2px 0 0 0;
	width:100%;
	text-align:center;
	border-bottom:#BF0000 solid 2px;
}
#KansyaFes li{
	display:inline;
	border-bottom:none;
	margin:0;
	padding:4px;
}
#KansyaFes li a:hover{
	background-color: #F00;
}
#KansyaFes p{
	text-align:center;
}
.ShohinList{
	width:100%;
	padding:0;
}
.ShohinList ul{
	text-align:center;
	margin:0;
	padding:0;
}
.ShohinList li{
	display: inline;
	list-style: none;
	margin:0;
	padding:0;
}
.ShohinList img{
	border:#FF0000 solid 1px;
}
.mannaka{
	text-align:center;
}
/*--------新米予約リスト------------------------------------------------------------*/
#YoyakuMai {
  width: auto;
  font-size: 14px;
  color:#333333;
  padding:5px;
}
#YoyakuMai h2{
  width: auto;
  font-size: 16px;
  padding:5px;
  text-align:center;
}
#YoyakuMai ul{
	width: auto;
	padding:0;
}
#YoyakuMai li {
  list-style-type : none;
  color:#333333;
  background-color:#E5E5E5;
  border-top:1px solid #fff;
  border-bottom:1px solid #999;
}
#YoyakuMai li:first-child{
  border-top:0px;
}
#YoyakuMai li:last-child{
  border-bottom:0px;
}
#YoyakuMai li a{
  text-decoration:none;
  color:#0e2236;
  display:block;
  padding:5px 5px;
  -moz-transition-property: all;
  -moz-transition-duration: 0.2s;
  -moz-transition-timing-function: linear;
  -webkit-transition: all 0.2s linear 0;
}
#YoyakuMai li a:hover{
  color:#ff0099;
  padding:5px 8px 5px 12px;
  background:rgba(255,255,255,0.5);
  filter: progid:DXImageTransform.Microsoft.gradient(GradientType=0,startColorstr='#99ffffff', endColorstr='#99ffffff');
}
/*----------------------------------------------------------------------------*/
</style>


